import './App.css';
import tareasLogo from './imagenes/portapapeles.png';
function App() {
  return (
    <div className="aplicacion-tareas">
     <div className='logo-contenedor'/>
     <img 
     src={tareasLogo}
     className='freeLogo' />
    </div>
  );
}

export default App;
